import React, { useState } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

export default function UploadProd() {
  const [formData, setFormData] = useState({
    name: "nongBonga",
    image: "quisasat",
    price: 2078.0,
    methodOfPayment: 0,
    discount: 87002351,
    userId: 1,
    description: "gamd f45",
  });
  return (
    <>
      <Navbar />
      <Footer />
    </>
  );
}
